import React from "react";
function Card ({children,reverse}){
    return(
        <div  style={{backgroundColor:reverse ?rgba(0,0,0,0.4):"white" }}
        >
            {children}
        </div>
    )
}
Card.defaultProps={
    reverse:true
}
export default Card;
